        const groupedData = {};

        rawData.forEach(entry => {
            const { heuristic, instance, heuristicCallTimes, problemDomain } = entry;

            if (!groupedData[heuristic]) {
                groupedData[heuristic] = {};
            }

            if (!groupedData[heuristic][instance]) {
                groupedData[heuristic][instance] = {
                    runs: [],
                    problemDomain: problemDomain // problemDomain
                };
            }

            groupedData[heuristic][instance].runs.push(heuristicCallTimes);
        });

        // 
        const chartsContainer = document.getElementById('charts-container');

        Object.keys(groupedData).forEach(heuristic => {
            const heuristicData = groupedData[heuristic];

            Object.keys(heuristicData).forEach(instance => {
                const instanceData = heuristicData[instance];
                const runs = instanceData.runs;
                const problemDomain = instanceData.problemDomain;
                const ctx = document.createElement('canvas');
                chartsContainer.appendChild(ctx);

                // 
                const average = runs.reduce((acc, val) => acc + val, 0) / runs.length;

                new Chart(ctx, {
                    type: 'bar',
                    data: {
                        labels: ['Run 1', 'Run 2', 'Run 3', 'Run 4', 'Run 5', 'Average'],
                        datasets: [{
                            label: `${heuristic} - ${instance}`,
                            data: [...runs, average],
                            backgroundColor: 'rgba(75, 192, 192, 0.2)',
                            borderColor: 'rgba(75, 192, 192, 1)',
                            borderWidth: 1
                        }]
                    },
                    options: {
                        responsive: true,
                        scales: {
                            y: {
                                beginAtZero: true
                            }
                        },
                        plugins: {
                            title: {
                                display: true,
                                // problemDomain
                                text: `${heuristic} (${problemDomain}) Performance for ${instance}`
                            }
                        }
                    }
                });
            });
        });
    </script>
